var rates = {}
var saved_rates = localStorage.getItem("rates");
if(saved_rates) {
    rates = JSON.parse(saved_rates);
} else {
	$('#currency-warning').css('display', 'block').slideDown();
    rates = {
        usd: 156,
        gbp: 202,
        inr: 2.2,
        bdt: 1.84,
        lkr: 0.86,
        aed: 42.44,
        pkr: 1
    };
	localStorage.setItem("rates", JSON.stringify(rates));
}

$.each( rates, function( cur, rate ){
    $( "#cur-" + cur ).val(rate);
});

$("#currency-form").on("submit", function(e){
	e.preventDefault();

	$.each( rates, function( cur, rate ){
		rates[cur] = parseFloat($( "#cur-" + cur ).val());
	});
	localStorage.setItem("rates", JSON.stringify(rates))
	$("#tick").addClass('appear');
	$('#currency-warning').css('display', 'none').slideUp();
	setTimeout(function(){
		$("#tick").removeClass('appear');
	}, 3000);
});

var form = {};
var shipping = {};
var shipping_rate = {};
var total_weight = 0;

function calc_currency(pkr, curr) {
	var this_shipping = 0;
	var price_with_shipping = pkr;
	if(total_weight){
		if(curr == "usd"){
			// this_shipping = parseInt(shipping_rate["us_ca"]);
			if (total_weight < 20) {
				this_shipping = ((total_weight-1) * 595) + 3250;
			} else {
				this_shipping = 595 * total_weight;
			}

			price_with_shipping = pkr + this_shipping;
			console.log("Applying shipping rate of US/CA for USA: " + this_shipping + " = " + price_with_shipping);
		} else if(curr == "gbp"){
			// this_shipping = parseInt(shipping_rate["great_britain"]);
			if (total_weight < 20) {
				this_shipping = ((total_weight-1) * 380) + 1800;
			} else {
				this_shipping = 380 * total_weight;
			}

			price_with_shipping = pkr + this_shipping;
			console.log("Applying shipping rate of Great Britain for UK: " + this_shipping + " = " + price_with_shipping);
		} else if(curr == "inr"){
			this_shipping = parseInt(shipping_rate["south_asia"]);
			price_with_shipping = pkr + this_shipping;
			console.log("Applying shipping rate of South Asia for IND: " + this_shipping + " = " + price_with_shipping);
		} else if(curr == "bdt"){
			// this_shipping = parseInt(shipping_rate["south_asia"]);
			this_shipping = ((total_weight-1) * 850) + 3500;

			price_with_shipping = pkr + this_shipping;
			console.log("Applying shipping rate of South Asia for BAN: " + this_shipping + " = " + price_with_shipping);
		} else if(curr == "lkr"){
			// this_shipping = parseInt(shipping_rate["south_asia"]);
			this_shipping = ((total_weight-1) * 850) + 3500;

			price_with_shipping = pkr + this_shipping;
			console.log("Applying shipping rate of South Asia for LKA: " + this_shipping + " = " + price_with_shipping);
		} else if(curr == "aed"){
			this_shipping = parseInt(shipping_rate["ae"]);
			price_with_shipping = pkr + this_shipping;
			console.log("Applying shipping rate of AE for UAE: " + this_shipping + " = " + price_with_shipping);
		} else if(curr == "pkr"){
			this_shipping = 700;
			price_with_shipping = pkr + this_shipping;
			console.log("Applying shipping rate of 700 for PAK = " + price_with_shipping);
		}
	}
	return Math.round( ( price_with_shipping / rates[curr] ) );
}

$("#converter-form").on("submit", function(e){
	e.preventDefault();

	form = {};
	console.clear();
	$(this).find("input").each(function(){
		form[this.name] = parseFloat($(this).val());
	});

	// Details table
	var details = "<tr><td>" + form.price + "</td><td>";
	details += form.stitching ? form.stitching + "</td><td>" : "</td><td>";
	details += form.quantity + "</td><td>";
	details += form.weight ? form.weight + "</td></tr>" : "</td></tr>";

	$("#details-body").html(details);

	var total = 0;

	if(form.stitching){
		total = form.price;
		console.log("Product Price: " + total );

		total = form.price + form.stitching;
		console.log("Price + Stitching: " + total );
		
		total *= form.quantity;
		console.log( form.quantity + " Quantity: " + total );
	}

	total_weight = Math.round(form.weight ? form.weight * form.quantity : 0);
	console.log("Total weight of package: " + total_weight + " kg");
	if(total_weight == 0){
		console.warn("No shipping applied.");
	} else if(total_weight > 300){
		console.error("Shipping rate for weight more than 300 kg are not defined in sheet, applying rates of 300kg.");
		shipping_rate = shipping[300];
	} else {
		shipping_rate = total_weight ? shipping[total_weight] : {};
	}

	if(form.stitching){
		console.info("Pricing for Stitched Products:");

		total_in_usd = calc_currency( total, 'usd' );
		console.log("Price in USD on rate " + rates.usd + ": " + total_in_usd );

		total_in_gbp = calc_currency( total, 'gbp' );
		console.log("Price in GBP on rate " + rates.gbp + ": " + total_in_gbp );

		total_in_inr = calc_currency( total, 'inr' );
		console.log("Price in INR on rate " + rates.inr + ": " + total_in_inr );

		total_in_bdt = calc_currency( total, 'bdt' );
		console.log("Price in BDT on rate " + rates.bdt + ": " + total_in_bdt );

		total_in_lkr = calc_currency( total, 'lkr' );
		console.log("Price in LKR on rate " + rates.lkr + ": " + total_in_lkr );

		total_in_aed = calc_currency( total, 'aed' );
		console.log("Price in AED on rate " + rates.aed + ": " + total_in_aed );

		total_in_pkr = calc_currency( total, 'pkr' );
		console.log("Price in PKR on rate " + rates.pkr + ": " + total_in_pkr );

		var stiched_row = "<td>" + total_in_usd + "</td>" + "<td>" + total_in_gbp + "</td>" +  "<td>" + total_in_inr + "</td>" + "<td>" + total_in_bdt + "</td>" + "<td>" + total_in_lkr + "</td>" + "<td>" + total_in_aed + "</td>" + "<td>" + total_in_pkr + "</td>";

		$("#stitched-row").html(stiched_row);

		$("#stitched-table").show();
	} else {
		$("#stitched-row").html("<td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td><td>&nbsp;</td>");
		$("#stitched-table").hide();
	}

	total = 0;

	total = form.price;
	console.log("Product Price without Stitching: " + total );

	total *= form.quantity;
	console.log( form.quantity + " Quantity: " + total );

	console.info("Pricing for Unstitched Products:");

	var total_in_usd = calc_currency( total, 'usd' );
	console.log("Price in USD on rate " + rates.usd + ": " + total_in_usd );

	var total_in_gbp = calc_currency( total, 'gbp' );
	console.log("Price in GBP on rate " + rates.gbp + ": " + total_in_gbp );

	var total_in_inr = calc_currency( total, 'inr' );
	console.log("Price in INR on rate " + rates.inr + ": " + total_in_inr );

	var total_in_bdt = calc_currency( total, 'bdt' );
	console.log("Price in BDT on rate " + rates.bdt + ": " + total_in_bdt );

	var total_in_lkr = calc_currency( total, 'lkr' );
	console.log("Price in LKR on rate " + rates.lkr + ": " + total_in_lkr );

	var total_in_aed = calc_currency( total, 'aed' );
	console.log("Price in AED on rate " + rates.aed + ": " + total_in_aed );

	var total_in_pkr = calc_currency( total, 'pkr' );
	console.log("Price in PKR on rate " + rates.pkr + ": " + total_in_pkr );

	var unstiched_row = "<td>" + total_in_usd + "</td>" + "<td>" + total_in_gbp + "</td>" +  "<td>" + total_in_inr + "</td>" + "<td>" + total_in_bdt + "</td>" + "<td>" + total_in_lkr + "</td>" + "<td>" + total_in_aed + "</td>" + "<td>" + total_in_pkr + "</td>";

	$("#unstitched-row").html(unstiched_row);

});



